import axios from "axios";

const USUARIO_BASE_REST_API_URL = "http://localhost:9001/Laboratorio1/personas";

class PersonaService{

    getAllPersonas(){
        return axios.get(this.USUARIO_BASE_REST_API_URL + "all").then(res => {
            console.log(res.data);
        });
    }
}

export default new PersonaService();
